import React, { useState } from 'react';
import 'bootstrap/dist/css/bootstrap.min.css';

const App = () => {
  const [currentPage, setCurrentPage] = useState('home');

  const handleMenuClick = (page) => {
    setCurrentPage(page);
  };

  return (
    <div className="container-fluid">
      <div className="row">
        {/* Left Column */}
        <div className="col-md-9">
          {currentPage === 'home' && <HomePage />}
          {currentPage === 'about' && <AboutPage />}
          {currentPage === 'contact' && <ContactPage />}
          {/* Add more pages as needed */}
        </div>

        {/* Right Column - Menus */}
        <div className="col-md-3 bg-light">
          <ul className="list-group">
            <li className="list-group-item" onClick={() => handleMenuClick('home')}>
              Home
            </li>
            <li className="list-group-item" onClick={() => handleMenuClick('about')}>
              About
            </li>
            <li className="list-group-item" onClick={() => handleMenuClick('contact')}>
              Contact
            </li>
            {/* Add more menu items as needed */}
          </ul>
        </div>
      </div>
    </div>
  );
};

const HomePage = () => <div>Home Page Content</div>;
const AboutPage = () => <div>About Page Content</div>;
const ContactPage = () => <div>Contact Page Content</div>;

export default App;
